import React from "react";
import Input from "../../Input/Input";
import classes from "./Crypto.module.css";

function Crypto(props) {

  const { loanValueBorrow, loanWInterestBorrow, loanValueDollars, repayInterestPlusLoan } = {...props.data}

  return (
    <>
      <h2 className={props.header}>Crypto Trade</h2>
      <div className={props.container}>
        <h2>Crypto</h2>
        <Input title="Coin Price" />
        <Input title="Borrowed Amount ADA" value={loanValueBorrow}/>
        <Input title="Borrowed Amount ($)" value={loanValueDollars}/>
        <Input title="Purchase Price" />
        <Input title="Amount Purchased" />
        <Input title="Total Invested" />
        <Input title="Borrowed Payment ADA" value={loanWInterestBorrow}/>
        <Input title="Borrowed Payment ($)" value={repayInterestPlusLoan}/>
        <Input title='Sale Price' />
        <Input title='Profit/Loss' />
      </div>
    </>
  );
}

export default Crypto;
